ATENÇÃO:🚨🚨🚨🚨🚨🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷🇧🇷

O EXÉRCITO DISSE QUE O POVO QUE ESTA NA FRENTE DOS QUARTEIS ESTAO LUTANDO CONTRA ATOS ANTI DEMOCRÁTICO;

O EXÉRCITO CRITICOU A INPRENSA, Dizendo QUE A INPRENSA Estavam ESCONDENDO AS MANIFESTAÇÕES;

DISSE QUE O POVO ESTA PROTESTANDO CONTRA AMEAÇAS A LIBERDADE;

ELES DISSERAM QUE A MIDIA CONTROLADORA NAO IMPEDIU A QUEDA DO MURRO DE BERLIM;

DISSERAM QUE A HISTÓRIA ENSINA QUE AS PESSOAS QUE LUTAM PELA LIBERDADE JAMAIS SERAO VENCIDAS;

E AGRADECEU A CONFIANÇA DO POVO;

O MURRO VAI CAIR;

CONTINUEM;

AS FFAA ESTAO DO NOSSO LADO;

PAULO FIGUEIREDO E CARLA ZAMBELI JA DENUNCIARAM AS FRAUDES NA COMISSÃO INTERAMERICANA DE DIREITOS HUMANOS;

O ARGENTINO JA SABE DE MUITA COISA;

O PL ENTROU COM UM PEDIDO PRA ANULAR AS ELEIÇÕES;

MAS CONTINUEM NA FRENTE DOS QUARTEIS NAO SAIM ATE TERMOS UMA RESPOSTA DIRETA
